import React, { Component } from 'react';
import './App.css';

class App extends Component {
  foo = () => 'Bats';

  render() {
    const name = 'Alex Bogdanov';
    const loading = true;
    const showName = true;

    return (
      <div className='App'>
        {loading ? (
          <h4>Loading...</h4>
        ) : (
          <h1>Hello {showName ? name : null}</h1>
        )}
      </div>
    );
  }
}

export default App;
